import React, {useState} from 'react'

const UserState = () => {

    const [count, setCount] = useState(0)
    return (
        <div>
            <h1>react</h1>
            <h2>{count}</h2>
            <button onClick={()=> {setCount(count + 1)}}>Add</button>
            <button onClick={() => {setCount}}>Remove</button>
        </div>
    )
}

export default UserState
